import React, { useState } from 'react';
import { useLoadScript } from '@react-google-maps/api';
import { useNavigate } from 'react-router-dom';
import './LandingPage.css';

const libraries = ['places'];

const LandingPage = () => {
    const navigate = useNavigate();
    const [searchInput, setSearchInput] = useState('');
    const [loading, setLoading] = useState(false);
    const [error, setError] = useState(null);

    const { isLoaded, loadError } = useLoadScript({
        googleMapsApiKey: process.env.REACT_APP_GOOGLE_MAPS_API_KEY,
        libraries,
    });

    if (loadError) {
        return <div>Error loading maps</div>;
    }

    if (!isLoaded) {
        return <div>Loading...</div>;
    }

    useEffect(() => {
        // Check if Google Maps API is loaded
        const initializeGoogleMaps = () => {
            if (!window.google || !window.google.maps) {
                setError("Google Maps API failed to load. Please refresh the page.");
                console.error("Google Maps API not loaded.");
                return;
            }

            console.log("Google Maps API loaded successfully.");
        };

        initializeGoogleMaps();
    }, []);

    useEffect(() => {
        if (!window.google || !window.google.maps) {
            setError("Google Maps API is not ready yet.");
            return;
        }
        // Initialize autocomplete
        try {
            const input = document.getElementById('location-search');
            if (input) {
                const autocomplete = new window.google.maps.places.Autocomplete(input, {
                    componentRestrictions: { country: "us" }
                });

                autocomplete.addListener('place_changed', () => {
                    const place = autocomplete.getPlace();
                    if (place.geometry && place.geometry.location) {
                        setSearchInput(place.formatted_address);
                        navigateToResults({
                            address: place.formatted_address,
                            coordinates: {
                                lat: place.geometry.location.lat(),
                                lng: place.geometry.location.lng()
                            }
                        });
                    }
                });
            }
        }
        catch (err) {
            console.error('Error initializing Google Maps:', err);
            setError('Failed to load map services');
        }

    }, []);

    const navigateToResults = (location) => {
        navigate('/restaurants', {
            state: {
                searchLocation: location
            }
        });
    };

    const handleSearch = () => {
        if (!searchInput) return;

        if (!window.google || !window.google.maps) {
            setError('Map services not available');
            return;
        }

        setLoading(true);
        const geocoder = new window.google.maps.Geocoder();
        geocoder.geocode({ address: searchInput }, (results, status) => {
            setLoading(false);
            if (status === 'OK' && results[0]) {
                const location = results[0].geometry.location;
                navigateToResults({
                    address: searchInput,
                    coordinates: {
                        lat: location.lat(),
                        lng: location.lng()
                    }
                });
            } else {
                setError('Could not find this location');
            }
        });
    };

    return (
        <div className="landing-page">
            <div className="hero-section">
                <h1>Find your next favorite restaurant</h1>
                <div className="main-search">
                    <div className="search-container">
                        <input
                            id="location-search"
                            type="text"
                            placeholder="Enter any address..."
                            className="main-search-input"
                            value={searchInput}
                            onChange={(e) => setSearchInput(e.target.value)}
                            onKeyPress={(e) => {
                                if (e.key === 'Enter') {
                                    handleSearch();
                                }
                            }}
                            disabled={loading}
                        />
                        <button
                            className="main-search-button"
                            disabled={loading}
                            onClick={handleSearch}
                        >
                            <i className="fas fa-search"></i>
                        </button>
                    </div>

                    {error && (
                        <div className="error-message">
                            {error}
                            <button
                                className="close-error"
                                onClick={() => setError(null)}
                            >
                                <i className="fas fa-times"></i>
                            </button>
                        </div>
                    )}
                </div>
            </div>

            <div className="categories-section">
                <h2>Popular Categories</h2>
                <div className="category-grid">
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1514326640560-7d063ef2aed5?w=400&h=300&q=80"
                            alt="Fine Dining"
                        />
                        <h3>Fine Dining</h3>
                    </div>
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1565299624946-b28f40a0ae38?w=400&h=300&q=80"
                            alt="Casual Dining"
                        />
                        <h3>Casual Dining</h3>
                    </div>
                    <div className="category-card">
                        <img
                            src="https://images.unsplash.com/photo-1513185158878-8d8c2a2a3da3?w=400&h=300&q=80"
                            alt="Fast Food"
                        />
                        <h3>Fast Food</h3>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default LandingPage;
